import React, { Component } from "react";
import { Form, Button } from "reactstrap";
import { GeneratorInput } from "./GeneratorInput";

class GeneratorForm extends Component {
  constructor() {
    super();
    this.state = {
      dataType: "integer",
      numCols: "",
      modalOptions: ""
    };
  }

  render() {
    return (
      <Form>
        <GeneratorInput />
        <GeneratorInput />
        <GeneratorInput />

        <Button type="submit" color="primary">
          Submit
        </Button>
      </Form>
    );
  }
}

export { GeneratorForm };
